Data Engineer
Agoura Hills, CA (Remote to start temporarily)
October 9, 2020
Rooftop Digital is seeking a motivated and eager individual for our Data Engineer position, located in Agoura Hills, CA (temporarily remote to start).

Who we are:
Imagine a place where innovative ideas and vibrant culture comes together in a collaborative environment and where teamwork is appreciated and celebrated - that’s Rooftop Digital.

Rooftop is a data-driven martech company focused on new customer acquisition for consumer brands. We build best-in-class publishing products & services that automates lead generation and data monetization at scale. By utilizing our consumer profiling, data intelligence engine and messaging platform, we market relevant products and services so consumers can make informed buying decisions. Our team culture is based on a collaborative approach in pushing boundaries and delivering results for our brand partners, while always keeping consumers’ best interest in mind.

If you are extremely detailed and enjoy the complexities involved with tracking and keeping up with information from various sources, or if you see life as a puzzle and enjoy finding creative ways of piecing that puzzle together, this might be a great opportunity for you. Come join a team that has a Silicon Valley start-up vibe where we celebrate new ideas, hard work, and building new and lasting friendships.

Principle Responsibilities & Duties:
The Data Engineer will manage the data architecture in order to provide the means for efficient use and visibility of data across the data landscape. This includes ensuring that all data systems are managed in accordance to industry best practices, designing and developing methods for data accessibility, and determining edge case technologies for innovative uses.

This list of job duties and responsibilities is not meant to be an all-inclusive list; additional responsibilities may be added in future.

The candidate will be expected to:
Develop data pipelines and build out integrations to support continuing increases in data volume and complexity;
Assist in the design, construction, testing and maintenance of data management systems;
Build high-performance algorithms, predictive models, and prototypes;
Evaluate and integrate data management and software engineering technologies into existing data structures;
Develop set processes for data mining, data modeling, and data production;
Research new uses for existing data;
Utilize appropriate languages and tools to connect systems together;
Collaborate across functional teams to improve data models that feed business intelligence tools, increasing data accessibility and fostering data-driven decision making across the organization;
Implement processes and systems to monitor data quality, data accuracy and data availability;
Initiate and validate disaster recovery procedures;
Ensure that all systems meet the business/company standards as well as industry practices and compliance requirements;
Perform data analysis as required to troubleshoot data related issues and assist in the resolution of data issues;
Recommend different ways to constantly improve data reliability and quality;
Perform other duties as assigned by the manager.

Minimum Requirements and Skills:
Bachelor’s degree in computer science, software/computer engineering, applied mathematics, or physics statistics;
4+ years of SQL experience (No-SQL experience is a plus);
Practical experience or knowledge of Python or R is a plus;
Experience in a marketing or related field using large data sets;
Experience with or knowledge of Agile Software Development methodologies;
Excellent problem solving and troubleshooting skills;
Process oriented with great documentation skills.

Employee Benefits provided by the company:
Competitive Compensation and Incentive Plans
Health/Dental Insurance
Life Insurance & Accidental Death and Dismemberment
Paid Time-Off (PTO) and Holidays
401(k) Qualified Retirement Plan
Company-sponsored lunches

